import './App.css';
import React from 'react';

class Professores extends React.Component
{
  constructor(props)
  {
    super(props);
    this.professores = [];
    this.updateProfs();
  }
  updateProfs()
  {
    fetch('test.json',
          {
            mode: 'no-cors',
            headers: {
              'Content-Type': 'application/json',
              'Accept': 'application/json'
            }
          })
    .then((response) =>
      {
        if (response.ok)
        {
          return response.json();
        }
      })
    .then((contents) =>
      {
        console.log(contents);
        console.log(this.state.professores);
        this.professores = contents;
        //this.setState({professores: contents});
      });
  }
  render()
  {
    return (
      <div>
        <h1>Professores</h1>
        <ol>
          {this.state.professores.map((prof) => (
            <li key={prof.id}>{prof.name}</li>
          ))}
        </ol>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
